<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00205
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 - resistant dihydrofolate reductase enzymes of Plasmodium falciparum are not enzymatically compromised in vitro . Plasmodium falciparum , the protozoan that causes the most lethal form of human malaria , has been controlled principally by two safe , affordable drugs , chloroquine and sulfadoxine-pyrimethamine ( SP ) . Studies in the laboratory and in the field have demonstrated that resistance to SP depends on non-synonymous point mutations in the dihydrofolate reductase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00374
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) , and dihydropteroate synthase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P49366
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) coding regions . Parasites that carry dhfr genes with 3 or 4 point mutations ( 51I / 59R / 108N triple mutation or 51I / 59R / 108N / 164L quadruple mutation ) are resistant to pyrimethamine in vitro and patients infected with these parasites respond poorly to SP treatment . The wide spread of these pyrimethamine-resistant alleles demonstrates the increased fitness over drug-sensitive alleles in the presence of the drug . However , it is not clear whether these alleles might reduce the fitness of parasites in the absence of drug pressure . As a first step , we compared the kinetic properties of the wild type , and three mutant alleles to determine whether the native 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00374
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - thymidylate synthase form of the mutant proteins showed compromised activity in vitro . The mutant enzymes had K ( m ) values for their substrate , dihydrofolate that were significantly lower than the wild type , k ( cat ) values in the same range as the wild type enzyme , and k ( cat ) / K ( m ) values higher than wild type . In contrast , the K ( m ) values for the NADPH cofactor were higher than wild type for the mutant enzymes . These observations suggest that the fitness of these parasites may not be compromised relative to those that carry the wild type allele , even without sustained SP drug pressure .</div>

<h2 style="margin: 0">1</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P10275
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 is expressed in murine choroid plexus and downregulated by 5alpha - dihydrotestosterone in male and female mice . The choroid plexuses ( CPs ) of the brain form a unique interface between the peripheral blood and the cerebrospinal fluid ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P04141
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) . CPs produce several neuroprotective peptides , which are secreted into the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P04141
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 . Despite their importance in neuroprotection , the mechanisms underlying the regulation of most of these peptides in CPs remain unknown . Androgens regulate the expression of neuroprotective peptides in several tissues where the androgen receptor ( AR ) is coexpressed , including the brain . The presence of AR in CPs has never been investigated , but recent studies in our laboratory show that the CP is an androgen-responsive tissue . In order to fulfill this gap , we investigated and characterized AR distribution and expression in male and female rat CPs and in primary cultures from rat CP epithelial cells . In addition , the response of AR to 5alpha - dihydrotestosterone ( 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB02901
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 ) in castrated male and female mice subjected to 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB02901
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 replacement was analyzed . We show that rat CP epithelial cells contain AR mRNA and protein . Moreover , we demonstrate that AR is downregulated by

<div class="entities" style="line-height: 2.5; direction: ltr">Biophysical and pharmacological characterization of hypotonically activated chloride currents in cortical astrocytes . Rat cortical astrocytes regulate their cell volume in response to hypotonic challenge . This regulation is believed to depend largely on the release of chloride or organic osmolytes through anion channels . Using whole-cell recordings , we identified weakly outwardly rectifying chloride currents that could be activated in response to hypotonic challenge . These currents exhibited the following permeability sequence upon replacement of chloride in the bathing solution with various anions : I - &gt; NO3 - &gt; Cl - &gt; Gluc - &gt; or = MeS - &gt; Ise - . Interestingly , extracellular I - , albeit showing the greatest permeability , blocked the currents with an IC50 of approximately 50 mM . Currents were almost completely inhibited by 123 microM P16860 and partially inhibited by 200 microM niflumic acid or 200 microM DIDS . Additionally , the total number of Cl - ions effluxed through the hypotonically activated channels was markedly similar to the total solute efflux during volume regulation . We therefore propose the hypotonically activated chloride channel as a major contributor to volume regulation of astrocytes . To examine potential candidate chloride channel genes expressed by astrocytes , we employed RT-PCR to demonstrate the presence of transcripts for

<div class="entities" style="line-height: 2.5; direction: ltr">The testis anion transporter TAT 1 ( Q96RN1 ) physically and functionally interacts with the cystic fibrosis transmembrane conductance regulator channel : a potential role during sperm capacitation . The Slc 26 gene family encodes several conserved anion transporters implicated in human genetic disorders , including Pendred syndrome , diastrophic dysplasia and congenital chloride diarrhea . We previously characterized the TAT 1 ( testis anion transporter 1 ; Q96RN1 ) protein specifically expressed in male germ cells and mature sperm and showed that in the mouse , deletion of Tat 1 caused male sterility due to a lack of sperm motility , impaired sperm capacitation and structural defects of the flagella . Ca ( 2 + ) , Cl ( - ) and HCO ( 3 ) ( - ) influxes trigger sperm capacitation events required for oocyte fertilization ; these events include the intracellular rise of cyclic adenosine monophosphate ( DB02527 ) and protein kinase A ( PKA ) - dependent protein phosphorylation . The cystic fibrosis transmembrane conductance regulator (

 ) is expressed in mature sperm and has been shown to contribute to Cl ( - ) and HCO ( 3 ) ( - ) movements during capacitation . Furthermore , several members of the SLC 26 family have been described to form complexes with

 , resulting in the reciprocal regulation of their activities . We show here that TAT 1 and

 physically interact and that in Xenopus laevis oocytes and in CHO -

<h2 style="margin: 0">19</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00205

 and WR99210 exert opposing selection on dihydrofolate reductase from Plasmodium vivax . Plasmodium vivax is a major public health problem in Asia and South and Central America where it is most prevalent . Until very recently , the parasite has been effectively treated with chloroquine , but resistance to this drug has now been reported in several areas . Affordable alternative treatments for vivax malaria are urgently needed .

 - sulfadoxine is an inhibitor of dihydrofolate reductase (

    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>

 ) that has been widely used to treat chloroquine-resistant Plasmodium falciparum malaria .

<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 inhibitors is unknown . We show that , like P . falciparum , point mutations in the dhfr gene can cause resistance to pyrimethamine in P . vivax . WR99210 is a novel inhibitor of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 , effective even against the most pyrimethamine-resistant P . falciparum strains . We have found that it is also an extremely effective inhibitor of the P . vivax 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00374
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>

<div class="entities" style="line-height: 2.5; direction: ltr">Prevalence of the dihydrofolate reductase DB00174 - 108 mutation as the basis for pyrimethamine-resistant falciparum malaria in the Brazilian Amazon .

 resistance in cultivated laboratory isolates of Plasmodium falciparum is linked to the dihydrofolate reductase mutation DB00174 - 108 , a mutation that acts by interrupting drug binding within the active site of the enzyme . To determine the prevalence of this mutation in endemic regions harboring pyrimethamine-resistant malaria , we used a mutation-specific polymerase chain reaction assay to survey P . falciparum strains from a wide section of the Brazilian Amazon . Mutations were identified directly from blood samples without intervening steps of in vitro cultivation . Of 42 samples collected from four states in Brazil , 38 ( 90 % ) contained the DB00174 - 108 codon AAC that confers pyrimethamine resistance , four samples contained only the wild-type DB00133 - 108 codon AGC , and none contained the DB00156 - 108 codon ACC found in cycloguanil-resistant pyrimethamine-sensitive strains . These findings indicate that a very high incidence of the DB00174 - 108

 mutation is responsible for pyrimethamine resistance in the Amazon , and they are consistent with recent failure rates reported for Fansidar ( pyrimethamine-sulfadoxine ) . We suggest that limited use of proguanil be evaluated as an alternative to pyrimethamine .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">P62158 and troponin C : affinity chromatographic study of divalent cation requirements for troponin I inhibitory peptide ( residues 104-115 ) , mastoparan and fluphenazine binding . The different conformations induced by the binding of Mg2 + or Ca2 + to troponin C ( TnC ) and calmodulin ( P62158 ) results in the exposure of various interfaces with potential to bind target compounds . The interaction of TnC or P62158 with three affinity columns with ligands of either the synthetic peptide of troponin I ( TnI ) inhibitory region ( residues 104-115 ) , mastoparan ( a wasp venom peptide ) , or fluphenazine ( a phenothiazine drug ) were investigated in the presence of Mg2 + or Ca2 + . TnC and P62158 in the presence of either Ca2 + or Mg2 + bound to the TnI peptide 104-115 . The cation specificity for this interaction firmly establishes that the TnI inhibitory region binds to the high affinity sites of TnC ( most likely the N-terminal helix of site III ) and presumably the homologous region of P62158 . Mastoparan interacted strongly with both proteins in the presence of Ca2 + but , in the presence of Mg2 + , did not bind to TnC and only bound weakly to P62158 .

 - TS alleles , both in tissue culture and in mice . Arg 59 + Asn 108 mutants ( using the P . falciparum numbering system ) exhibit no significant fitness defects in vitro , but a fitness defect of 1.8 % per generation in mice . Arg 59 + Ser 223 mutants exhibit fitness defects of &gt; 2.8 % per generation both in vitro and in vivo , which may explain why this highly pyrimethamine-resistant allele has not been observed in the field . It is important to note that long-term propagation of parasites in vitro or in vivo can produce adaptations affecting fitness by &gt; 3.7 % per generation , necessitating careful attention to background in head-to-head competition studies . A sensitive PCR-based assay permits different growth rates to be assessed even in the absence of a drug resistance marker that can be scored by plaque assay .</div>

<h2 style="margin: 0">52</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Genetic and biochemical markers in patients with Alzheimer ' s disease support a concerted systemic iron homeostasis dysregulation . Alzheimer ' s disease ( AD ) is the most common form of dementia in the elderly individuals , resulting from a complex interaction between environmental and genetic factors . Impaired brain iron homeostasis has been recognized as an important mechanism underlying the pathogenesis of this disease . Nevertheless , the knowledge gathered so far at the systemic level is clearly insufficient . Herein , we used an integrative approach to study iron metabolism in the periphery , at both genotypic and phenotypic levels , in a sample of 116 patients with AD and 89 healthy control subjects . To assess the potential impact of iron metabolism on the risk of developing AD , genetic analyses were performed along with the evaluation of the iron status profile in peripheral blood by biochemical and gene expression studies . The results obtained showed a significant decrease of serum iron , ferritin , and transferrin concentrations in patients compared with the control subjects . Also , a significant decrease of ferroportin ( Q9NP59 ) and both transferrin receptors 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P02786
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and Q9UP52 transcripts was found in peripheral blood mononuclear cells from patients . At the genetic level , significant associations with AD were found for single nucleotide polymorphisms in TF , Q9UP52 , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P21399
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , and Q9NP59 genes . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P02649
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 gene , a well-known risk factor for AD , was also found significantly associated with the disease in this study . Taken together , we hypothesize that the alterations on systemic iron status observed in patients could reflect an iron homeostasis dysregulation , particularly in cellular iron efflux . The intracellular iron accumulation would lead to a rise in oxidative damage , contributing to AD pathophysiology .</div>

 ) inhibitors pyrimethamine and proguanil are being used as alternative first-line drugs for the treatment and prevention of Plasmodium falciparum malaria . Resistance to these drugs is conferred by point mutations in parasite

<h2 style="margin: 0">55</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 hysteresis and its effect of inhibitor binding analyses . Escherichia coli dihydrofolate reductase was shown to follow slow transient kinetics ( hysteresis ) . Nonlinear reaction velocities were detected during the enzyme assay and required 10-15 min to reach a steady-state rate . The degree of hysteresis was influenced by the enzyme concentration and the order of substrate addition . Incubation of the enzyme with NADPH before addition of dihydrofolate resulted in slow initial velocities that increased up to 2 - fold during the course of the assay . Increasing the enzyme concentration from 0.2 to 1 nM resulted in diminished hysteresis . NADPH-initiated reactions were linear at all enzyme concentrations tested . Certain drugs had profound effects on hysteresis .

 practically eliminated the hysteresis of dihydrofolate-started reactions , whereas trimethoprime augmented the non-linearities in the sense that hysteresis was detected in both enzyme - and NADPH-started reactions . The shape of these reaction tracings makes trimethoprim is not a slow-binding inhibitor when assayed under conditions that eliminate hysteresis . Contrary to this , sulfamethoxazole did not affect hysteresis or augment inhibition of the enzyme by trimethoprim . Sulfamethoxazole alone ( at 6 mM ) did not inhibit the hysteresis and allow reliable determinations of Ki values of both weak and tight binding inhibitors . For example , Ki values for pyrimethamine , trimethoprim , and methotrexate were found to be 214 nM , 1.3 nM , and 0.021 nM , respectively .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Identification and analysis of specific chromosomal region adjacent to exogenous Dhfr-amplified region in Chinese hamster ovary cell genome . Chinese hamster ovary ( CHO ) cells are widely used for the stable production of recombinant proteins . Gene amplification techniques are frequently used to improve of protein production , and the dihydrofolate reductase (
